import React from 'react'
import { ParallaxBanner, withController } from 'react-scroll-parallax'


function handleLoad() {

}

function Home() {
    return (
        <div>
            <ParallaxBanner
                onLoad={() => handleLoad()}
                layers={[
                    {
                        image: require("./resources/photos/IMG1-2.jpg"),
                        amount: 0.2,

                    },

                    {
                        children: (<div style={{
                            marginTop: "15%",
                            marginLeft: "15%",
                            justifyContent: "center",
                            alignItems: "center",
                            width: "80%",

                        }}>
                            <Typography variant="h1">Welcome</Typography>
                            <Typography variant="h4">This is my portfolio Webpage</Typography>
                        </div>),
                        amount: 0.6,
                        expanded: false,
                    },
                ]}
                style={{
                    height: 'inherit',
                }}
                expanded={false}
            />
        </div>
    )
}

export default withController(Home);
